import React from 'react';
import Navbar from './Navbar';

const MealRecord = () => {
    return (
        <div>
            <Navbar/>
            <div className="divcss">
                <h2>Meal Record page</h2>
                <form>
                    <input type='text'></input>    
                </form>    
            </div>     
        </div>
    );
};

export default MealRecord;
